Steins;Gate
Company: Nitroplus &amp; 5pb.
Release date: Oct 15, 2009

Summary: The story of Steins;Gate takes place in Akihabara and is about a group of friends who have customized their microwave into a device that can send text messages to the past. As they perform different experiments, an organization named SERN who has been doing their own research on time travel tracks them down and now the characters have to find a way to avoid being captured by them. 



